import {Container, Table} from "reactstrap";
import React from "react";

const Recipe = ({title, text}) => {
    return(
        <Container>
            <Table>
                <tbody>
                    <tr>
                        <td>{title}</td>
                    </tr>
                    <tr>
                        <td>{text}</td>
                    </tr>
                </tbody>
            </Table>
        </Container>
    )
}

export default Recipe
